awslocal ses verify-email-identity --email yuma-tsurumi@secom.co.jp
awslocal ses verify-email-identity --email yuma-tsurumi@design.secom.co.jp

# SQS構築
cd /usr/local/terraform-wk/SQS
tflocal init
tflocal apply -var-file sqs.tfvars -auto-approve

